import React, { useState, useEffect } from 'react';
import Projects from "./views/Projects";
import "./style.css";
import TimeLoggerForm from "./components/TimeLogger/TimeLoggerForm";

export default function App() {
    const [selectedProject] = useState<Project>({
        projectId: 1,
        name: 'Project Example',
        deadline: '2024-01-31', // Use an appropriate date format
      });

      const [onLogTime] = useState<Project>({
        projectId: 1,
        startTime: '2024-01-31',
        endTime: '2024-02-31', // Use an appropriate date format
      });
    return (
        <>
            <header className="bg-gray-900 text-white flex items-center h-12 w-full">
                <div className="container mx-auto">
                    <a className="navbar-brand" href="/">
                        <TimeLoggerForm selectedProject={selectedProject} onLogTime={onLogTime} />
                    </a>
                </div>
            </header>

            <main>
                <div className="container mx-auto">
                    <Projects />
                </div>
            </main>
        </>
    );
}

interface Project {
    projectId: number;
    name: string;
    deadline: string; // Use the correct type for your project's deadline
    
  }
